  \"2016-07-16T01:34:19.318493\",\n\t\"name\": \"national-hydrography-dataset-nhdab2c5\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Hydrography Dataset (NHD)
  is a feature-based database that interconnects and uniquely identifies the stream
  segments or reaches that make up the nation's surface water drainage system. NHD
  data was originally developed at 1:100,000 scale and exists at that scale for the
  whole country. High resolution NHD adds detail to the original 1:100,000-scale NHD.
  (Data for Alaska, Puerto Rico and the Virgin Islands was developed at high-resolution,
  not 1:100,000 scale.) Like the 1:100,000-scale NHD, high resolution NHD contains
  reach codes for networked features and isolated lakes, flow direction, names, stream
  level, and centerline representations for areal water bodies. Reaches are also defined
  to represent waterbodies and the approximate shorelines of the Great Lakes, the
  Atlantic and Pacific Oceans and the Gulf of Mexico. The NHD also incorporates the
  National Spatial Data Infrastructure framework criteria set out by the Federal Geographic
  Data Committee.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
